script: |
  super -f text -I q4032.spq | sort > q4032.out

inputs:
  - name: q4032.spq
    data: |
      SELECT DISTINCT - 80, col2 + 91 + - 0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - 87 BETWEEN + 21 + + col0 + + + 86 * col2 AND NULL;
  - name: tab1

outputs:
  - name: q4032.out
    data: |
      -80	150
      -80	159
      -80	187
